import re

def palindromes_of_specific_lengths(string):
    substring = string[27:78].lower()
    palindromes = set()

    for length in range(18, 20):
        for start in range(len(substring) - length + 1):
            sub = substring[start:start+length]
            if sub == sub[::-1] and re.match('^[a-zA-Z]+$', sub):
                palindromes.add(sub)

    return palindromes
